import React from "react";
import Accordian from "../Components/accordians";
import CardText from "../Components/cardWithText";
import img1 from "../Images/services01.png";

// import service1Img from "../Images/service pae iot without background.png";

function Services() {
  return (
    <React.Fragment>
      <div className="d-md-flex container-md mt-5">
        <div>
          <h2>HEllooo...</h2>
        </div>
        <div className="mx-md-5 d-md-flex" style={{ width: "100%" }}>
          <div className="d-md-flex-column" style={{ width: "100%" }}>
            <Accordian count="01" />
            <Accordian count="02" />
          </div>
          <div className="d-md-flex-column" style={{ width: "100%" }}>
            <Accordian count="03" />
            <Accordian count="04" />
          </div>
        </div>
      </div>
      <div className="container-md">
        <div className="d-md-flex">
          <CardText heading="project1" imgUrl={img1} />
          <CardText heading="project1" />
        </div>
        <div className="d-md-flex">
          <CardText heading="project1" />
          <CardText heading="project1" />
        </div>
      </div>
    </React.Fragment>
  );
}

export default Services;
